import React from 'react';
import Navbar from '../Navbar/Navbar';
import './Style.css'

function Home(props) {
    const card = [
        { Name: " ", extra: "", img: "" },
        { Name: " ", extra: "", img: "" },
        { Name: " ", extra: "", img: "" },
        { Name: " ", extra: "", img: "" },
    ]
    return (
        <React.Fragment>
            <header>
                <Navbar />
            </header>
            <div className="body container border-left border-right">
                <div className="p-3 h2 ">Welcome to Caleb Mobile Waiter CWM</div>
                <div className="txt2">
                    Make orders with us and get your order under 1 hour <br />
                   Note : No refunds
               </div>
                <button className="ord-btn btn  btn-outline btn-info btn-info-outline" onClick={() => {
                    window.location.assign('/order')
                }}>
                    Order
               </button>
                {card.map(({ Name, extra, img }) => {
                    return (
                        <div className="card col-lg-3 mx-auto shadow rounded my-5" style={{ backgroundColor: "url('../images/download (1).jpeg')" }}>
                            <img src="../images/caleb-university.jpg" width="100%" alt="" height="300px" />
                        </div>
                    )
                })}
            </div>
        </React.Fragment>
    );
}
export default Home;
